import { BrowserRouter, Route } from "react-router-dom";
import Orders from "./Orders";
import Home from "./Home";

function Routes() {
    return (
        <BrowserRouter >
            <Routes>
            <Route path="/orders"><Orders/></Route>
            <Route path="/"><Home/></Route>
            </Routes>
        </BrowserRouter>
    )
}

export default Routes;
